import React from "react";
import Modal from "react-modal";
import Pokemon from "../Img/Pokemon.png";
import Country from "../Img/Country.gif";

import "./Projects.css";

const customStyles = {
  content: {
    top: "50%",
    left: "50%",
    right: "auto",
    bottom: "auto",
    marginRight: "-50%",
    transform: "translate(-50%, -50%)",
  },
};

const Projects = () => {
  const [modalIsOpen, setIsOpen] = React.useState(false);

  return (
    <div className="container ">
      <Modal
        isOpen={modalIsOpen}
        onRequestClose={() => setIsOpen(false)}
        style={customStyles}
        contentLabel="Example Modal"
      >
        <span>asdasd</span>
      </Modal>

      <div className="row">
        <div className="col-12 fs-1 text Projects pt-3">Mi Proyectos</div>
        <div className="col-12">
          <div className="row d-flex justify-content-around pt-5 g-4">
            {/* Card start Pokemon*/}
            <div className="col-2  container-card p-3">
              <img src={Pokemon} alt="noPokemon" />
              <div className="card-body">
                <h5 className="card-title">Api Rest</h5>
                <p className="d-none d-md-block card-text">
                  Un proyecto hecho con la API pública de
                  <div className="text-Projects fs-3 text">Pokémon </div>
                </p>
              </div>
              <button
                type="button"
                className="col-12 btn btn-outline-light mt-4"
              >
                Warning
              </button>
            </div>

            {/* Card end  */}
            {/* Card start Country*/}

            <div className="col-2  container-card p-3">
              <img src={Country} className="card-img-top" alt="Pais" />
              <div className="card-body">
                <h5 className="card-title">Api Rest</h5>
                <p className="d-none d-md-block card-text">
                  Un proyecto hecho con la API pública de
                  <div className="text-Projects fs-3 text">Pais </div>
                </p>
              </div>
              <button type="button" className="col-12 "></button>
            </div>
            {/* Card end  */}
            {/* Card start Pokemon*/}
            <div className="col-2  container-card p-3">
              <img src={Pokemon} alt="noPokemon" />
              <div className="card-body">
                <h5 className="card-title">Api Rest</h5>
                <p className="d-none d-md-block card-text">
                  Un proyecto hecho con la API pública de
                  <div className="text-Projects fs-3 text">Pokémon </div>
                </p>
              </div>
              <button
                type="button"
                className="col-12 btn btn-outline-light mt-4"
              >
                Warning
              </button>
            </div>

            {/* Card end  */}
          </div>
        </div>
      </div>
    </div>
  );
};

export default Projects;
